	}
	move = (id, time, type, x, y) => {
		this.animations.push({ id: id, time: time, type: type, x: x, y: y });
		this.refresh();
	}
	clean = (id) => {
		this.animations.map((value, index) => {
			if (value.id == id) {
				delete this.animations[index];
			}
		});
		this.refresh();
	}
}

